import React from 'react'
import { useParams } from 'react-router'
import {Tematicas} from '../data/tematicas'

export const Tematica = () => {

    const params = useParams();
    const tematica = Tematicas.find(tematica => Tematicas.Url === params.tematica);

    return (
        <div>
            Esta es una tematica  {tematica.Titulo}
        </div>
    )
}
